import React from 'react';
import { useNavigate } from 'react-router-dom';
import { authService } from '../../services/auth.service';
import {
  Box,
  Container,
  Typography,
  Grid,
  Paper
} from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import NotificationsIcon from '@mui/icons-material/Notifications';
import PersonIcon from '@mui/icons-material/Person';
import PaymentIcon from '@mui/icons-material/Payment';
import HistoryIcon from '@mui/icons-material/History';
import FeedbackIcon from '@mui/icons-material/Feedback';

export const StudentHome: React.FC = () => {
  const navigate = useNavigate();
  const currentUser = authService.getCurrentUser();

  const handleRegisterRoom = () => {
    navigate('/student/available-rooms');
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ mt: 4, mb: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom align="center">
          Ký túc xá Sinh viên
        </Typography>
        <Typography variant="subtitle1" align="center" color="text.secondary" sx={{ mb: 4 }}>
          Chào mừng, {currentUser?.user.username}!
        </Typography>

        <Grid container spacing={3}>
          {/* Thông tin phòng */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={() => navigate('/student/room-info')}
            >
              <HomeIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Thông tin phòng
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Xem thông tin về phòng ở và các tiện ích
              </Typography>
            </Paper>
          </Grid>

          {/* Đăng ký phòng */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={handleRegisterRoom}
            >
              <PersonIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Đăng ký phòng
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Đăng ký phòng ở mới hoặc thay đổi phòng
              </Typography>
            </Paper>
          </Grid>

          {/* Thông báo */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={() => navigate('/student/notifications')}
            >
              <NotificationsIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Thông báo
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Xem các thông báo mới từ ban quản lý
              </Typography>
            </Paper>
          </Grid>

          {/* Thanh toán */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={() => navigate('/student/payment')}
            >
              <PaymentIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Thanh toán
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Xem và thanh toán các khoản phí ký túc xá
              </Typography>
            </Paper>
          </Grid>

          {/* Lịch sử */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={() => navigate('/student/history')}
            >
              <HistoryIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Lịch sử
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Xem lịch sử đăng ký phòng và thanh toán
              </Typography>
            </Paper>
          </Grid>

          {/* Góp ý */}
          <Grid item xs={12} md={6}>
            <Paper 
              sx={{ 
                p: 3, 
                display: 'flex', 
                flexDirection: 'column',
                alignItems: 'center',
                cursor: 'pointer',
                '&:hover': {
                  backgroundColor: 'rgba(0, 0, 0, 0.04)'
                }
              }}
              onClick={() => navigate('/student/feedback')}
            >
              <FeedbackIcon sx={{ fontSize: 60, color: 'primary.main', mb: 2 }} />
              <Typography variant="h5" component="h2" gutterBottom>
                Góp ý
              </Typography>
              <Typography variant="body1" color="text.secondary" align="center">
                Gửi góp ý, khiếu nại về ký túc xá
              </Typography>
            </Paper>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};
